import React from 'react'
import { Button, Navbar, Nav, NavMenu, NavLink, NavDropdown, MenuItem } from 'react-bootstrap';
import Home from './Home'


class NavBar extends React.Component {



    render() {
        return (
            <Nav>
                <NavMenu>
                    <NavLink to="./Home" active>
                        Home
                    </NavLink>
                </NavMenu>
            </Nav>
        )
    }
}

export default NavBar
